 import Carousel from 'react-multi-carousel';
 import 'react-multi-carousel/lib/styles.css'
 import {Container,Row ,Col} from 'react-bootstrap';
 import hmtlIcon from '../assets/img/html-icon.svg';
 import cssIcon from '../assets/img/css-icon.svg';
 import jsIcon from '../assets/img/JS-icon.svg';
 import reactIcon from '../assets/img/react-icon.svg';
 import gitIcon from '../assets/img/git-icon.svg';
import { ProgressBarSkills } from './UI/ProgressBarSkills';

 export const Skills = () => {

  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };

  return(
    <section className='skill' id='skills'>
      <Container>
        <Row>
          <Col>
            <div className='skill-bx'>
              <h2>
                Skills
              </h2>
              <p>
                Culpa adipisicing labore aliqua aliquip ut et exercitation mollit proident irure commodo adipisicing anim qui. Esse ullamco consequat dolor mollit laboris aliqua dolor id aliqua dolor minim laborum. 
              </p>
              <Carousel className='skill-slider' responsive={responsive} infinite autoPlay>
                <div className='item'>
                  <ProgressBarSkills percentage>
                  <img src={hmtlIcon} alt='HTML' />
                  <h5>HTML 5</h5>
                  </ProgressBarSkills>
                </div>
                <div className='item'>
                  <img src={cssIcon} alt='CSS' />
                  <h5>CSS 3</h5>
                </div>
                <div className='item'>
                  <img src={jsIcon} alt='JavaScript' />
                  <h5>JavaScript ES6</h5>
                </div>
                <div className='item'>
                  <img src={reactIcon} alt='React' />
                  <h5>React</h5>
                </div>
                <div className='item'>
                  <img src={gitIcon} alt='Git' />
                  <h5>Git</h5>
                </div>
              </Carousel>
            </div>
          </Col>
        </Row>
      </Container>
    </section>
  );
 }
